  <a href='javascript:void(0)' class='closebtn' onclick='closeNav()'>&times;</a>
  Cross section:
  <form>

    <label for='noord-zuid'>north-south</label><br></br>

  <br></br>
  Viewpoints:
  <form>
    <input type='radio' name='viewpointRadios' id='radioVPtopdown' value='viewpoint_topdown' checked='checked' onclick='toggleViewpoint(this)'/>

  </form>
  <br></br>
  ImageTextureAtlas:
  <form>
    <input type='radio' name='volumeRadios' id='rgba' value='0' checked='checked' onclick='switchVolume(this)'/>
    <label for='rgba'>RGBA</label><br></br>
    <input type='radio' name='volumeRadios' id='rgba_tp' value='1' onclick='switchVolume(this)'/>

    <label for='gray_transfer'>Greyscale + transferFunction</label><br></br>

  <br></br>
  Reference:
